public final boolean equals(final Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  JobId other = (JobId) obj;
  if (jobIdentifier != other.jobIdentifier) {
    return false;
  }
  return true;
}
